  false,\n\t\"url\": null,\n\t\"notes\": \"Vernal pool ecosystem conservation and
  recovery requires the recovery team to develop methods to determine the distribution
  of vernal pool types throughout the Great Valley and associated recovery areas.
  The team must identify (or recommend the identification of) the great variation
  of biotic and physical factors which influence vernal pool diversity and correlate
  them to specific pool complexes. This will necessitate a unified vernal pool classification
  system and data base.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
